INSERT INTO `settings` (`id`, `about`, `about_ar`, `mission`, `mission_ar`, `vision`, `vision_ar`, `email`, `phone`, `map_link`, `keywords`, `description`, `og_title`, `og_description`, `og_image`, `author`) VALUES
(1, 'The AlWarqa Organization for Skills Development is a non-profit organization registered in Iraq that aims to empower and enhance the skills of individuals, particularly youth, through various training programs and workshops. Their focus is on developing practical skills in areas such as leadership, communication, problem-solving, and entrepreneurship, with the aim of creating a more skilled and competitive workforce. The organization also provides mentoring and coaching services to support individuals in achieving their personal and professional goals.', 'منظمة الورقة لتطوير المهارات هي منظمة غير ربحية مسجلة في العراق تهدف إلى تمكين وتعزيز مهارات الأفراد، وخصوصًا الشباب، من خلال برامج تدريبية وورش عمل متنوعة. تركز المنظمة على تطوير المهارات العملية في مجالات مثل القيادة، والاتصال، وحل المشكلات، وريادة الأعمال، بهدف خلق قوى عاملة أكثر مهارة وتنافسية. تقدم المنظمة أيضًا خدمات التوجيه والتدريب لدعم الأفراد في تحقيق أهدافهم الشخصية والمهنية.', 'Our mission at AlWarqa Organization is to establish an educational environment for information technology skills by offering courses and training programs to children and youth. We aim to cultivate information technology proficiency and logical thinking.', 'رسالتنا في منظمة الورقة هي إنشاء بيئة تعليمية لمهارات تكنولوجيا المعلومات من خلال تقديم دورات وبرامج تدريبية للأطفال والشباب. نهدف إلى تنمية الكفاءة في مجال تكنولوجيا المعلومات وتعزيز التفكير المنطقي.', 'Our vision is to empower youth with digital and life skills, foster innovation, and promote global partnerships that enrich Iraqi communities, all while raising awareness about the importance of human resource development and strategic planning. ', 'رؤيتنا هي تمكين الشباب بالمهارات الرقمية والحياتية، وتعزيز الابتكار، وتعزيز الشراكات العالمية التي تثري المجتمعات العراقية، كل ذلك مع زيادة الوعي بأهمية تطوير الموارد البشرية والتخطيط الاستراتيجي.', 'alwrqa.org@gmail.com', '+9647822278550', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d211.86856419785303!2d47.153726436898324!3d31.82779713386888!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3fe7eb81f5b4a317%3A0x351e6cd155d75e70!2z2YXZhti42YXYqSDYp9mE2YjYsdmC2Kkg2YTYqti32YjZitixINin2YTZhdmH2KfYsdin2Ko!5e0!3m2!1sar!2siq!4v1683967251034!5m2!1sar!2siq&amp;z=50\" width=\"100%\" height=\"95%\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '', '', '', '', '', '');

