(5, 'My coding story: Nadia | Code Club, Iraq', 'My_coding_story:_Nadia_|_Code_Club,_Iraq', 1, 'lUI2UWVCQ5s?si=eVGPk7C0EgFaozJM', '', '2023-09-28', '<p>As soon as Nadia, Head of Computer Science at Amara Technical Institute, Iraq, started volunteering with Code Club while studying in London, she knew she wanted to continue the mission back home by setting up the first Code Club in Iraq.</p><p>Looking for ways to get involved in the local community as an international Ph.D. student, Nadia found that volunteering with Code Club offered her the opportunity to share her passion for computer science with the next generation.&nbsp;</p><p>Nadia has a strong focus on opening up the tech sector to girls. Back home in Iraq, she trained a female-only team of Code Club volunteers and between them, they now run more than nine Code Clubs.</p><p>We want to help people put a Code Club in every community across the globe, so they can give every child the skills, confidence, and opportunity to change their world. If you would like to find out how you can join the global Code Club network, visit <a href=\"http://codeclub.org\" target=\"_blank\">http://codeclub.org</a>.</p><p>🤖💻🚀👩‍💻</p>', '1', 1);

